snippet.textDisplay:
@Bibicovendetudo Nova Friburgo RJ , algumas mulheres tem esse pensamento de culpar os homens por suas frustrações e esquecem que são responsáveis por suas próprias ações e escolhas.
No caso dos deslike a pessoa pode simplesmente não ter gostado do conteudo do vídeo e pronto .Seja homem ou mulher.
Nunca vi a Doutora Laura Lúcia se queixar de deslike.Ela sabe que isso sempre irá ocorrer.

